import React from "react";

const DynamicForm = () => {
  const submit = (e) => {
    e.preventDefault();
  };

  return (
    <div
      className="card"
      style={{ width: "600px", padding: "10px", margin: "20px auto" }}
    >
      <h3>Dynamic Form</h3>
      <form onSubmit={submit}>
        <div className="row mt-2">
          <div className="col">
            <input
              className="form-control"
              type="text"
              name="name"
              placeholder="Name"
            />
          </div>
          <div className="col">
            <input
              className="form-control"
              type="text"
              name="age"
              placeholder="Age"
            />
          </div>
        </div>
      </form>
    </div>
  );
};

export default DynamicForm;
